import './estilo.css';
import logo from '../../imagens/logo.svg'

const LogoContainer = sty

function Logo () {
    return (
        <div className='logo'>
            <img 
                src={logo} 
                alt='Logo Dev Books' 
                className='logo-img'
            ></img>
            <p><strong>Dev</strong>Books</p>
        </div>
    )
}

export default Logo;
